// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract EMS{

    uint256 public evidenceCount=0;
    uint256 public caseCount=0;
    struct Evidence {
        uint256 ID;
        string filename;
        string filetype;
        string desc;
        bool valid;
        address officer;
        uint256 caseID;
        string hash;
        uint256 timestamp;
    }
    Evidence[]  evidence;

    struct TrackEvidence{
        uint256 evidenceID;
        uint256 caseID;
        bool prev;
        bool valid;
        address updatedBy;
        uint256 timestamp;
    }
    TrackEvidence[] public trackEvidence;
    
    struct Case {
        uint256 ID;
        string UID;
        string SUID;
        string name;
        string desc;
        string caseType;
        string status;
        address upladedBy;
        uint256 timestamp;
    }
    Case[] public caseList;

    struct TrackChangeinDesc{
        uint256 caseID;
        string  UID;
        string prevDesc;
        string updatedDesc;
        address updatedBy;
        uint256 timestamp;
    }
    TrackChangeinDesc[] public trackChangeinDesc;

    struct TrackChangeinStatus{
        uint256 caseID;
        string  UID;
        string prevStatus;
        string updatedStatus;
        address updatedBy;
        uint256 timestamp;
    }
    TrackChangeinStatus[] public trackChangeinStatus;

    struct TrackChangeinSUID{
        uint256 caseID;
        string  UID;
        string prevSUID;
        string updatedSUID;
        address updatedBy;
        uint256 timestamp;
    }
    TrackChangeinSUID[] public trackChangeinSUID;

    mapping(string => bool) public UIDinCaseList;
    mapping(string => uint256) public UIDCase;
    mapping(uint256 => bool) public isCaseID;
    mapping(string => bool) public EvidenceisinList;
    mapping(string => uint256) public HashEvidence;
    mapping(string => TrackChangeinDesc[]) public trackChangeinDescMap;
    mapping(string => TrackChangeinStatus[]) public trackChangeinStatusMap;
    mapping(string => TrackChangeinSUID[]) public trackChangeinSUIDMap;
    mapping(string => Evidence[]) public CaseEvidence;



    modifier isInCaseList(string memory UID){
        require(!UIDinCaseList[UID],"Case with this UID already Exist");
        _;
    }
    function uploadCase(string memory UID,string memory SUID ,string memory _name, string memory _desc, string memory _type,string memory _status) public isInCaseList(UID){
        caseCount++;
        caseList.push(Case(caseCount, UID, SUID,_name, _desc, _type, _status,msg.sender,block.timestamp));
        UIDinCaseList[UID]=true;
        UIDCase[UID]=caseCount;
        isCaseID[caseCount] = true;
    }
    // function viewCase(string memory UID) public view returns(Case memory){
    //     require(UIDinCaseList[UID],"UID is not present");
    //     uint index = UIDCase[UID]-1;
    //     return caseList[index];
    // }
    function viewCase() public view returns(Case[] memory){
        return caseList;
    }
    

    

    function updateCaseDesc(uint256 ID,string memory desc) public {
        require(isCaseID[ID],"Case is not present");
        // require(keccak256(bytes(caseList[ID-1].desc))!=keccak256(bytes(desc)),"No changes");
        string memory prevDesc = caseList[ID-1].desc;
        caseList[ID-1].desc= desc;
        trackChangeinDesc.push(TrackChangeinDesc(ID,caseList[ID-1].UID,prevDesc,desc,msg.sender,block.timestamp));
        // string memory 
        // trackChangeinDescMap[UID].push(TrackChangeinDesc(ID,UID,prevDesc,desc,msg.sender,block.timestamp));
    }
    function viewTrackChangeinDesc()public view returns(TrackChangeinDesc[] memory){
        return trackChangeinDesc;
    }

    function updateCaseStatus(uint256 ID,string memory status) public{
        require(isCaseID[ID],"Case is not present");
        require(keccak256(bytes(caseList[ID-1].status))!=keccak256(bytes(status)),"No changes");
        string memory prevStatus = caseList[ID-1].status;
        caseList[ID-1].status= status;
        trackChangeinStatus.push(TrackChangeinStatus(ID,caseList[ID-1].UID,prevStatus,status,msg.sender,block.timestamp));
        // trackChangeinStatusMap[UID].push(TrackChangeinStatus(caseID,UID,prevStatus,status,msg.sender,block.timestamp));

    }
    function viewTrackChangeinStatus()public view returns(TrackChangeinStatus[] memory){
        return trackChangeinStatus;
    }

    function transferCase(uint256 ID,string memory SUID) public {
        require(isCaseID[ID],"Case is not present");
        require(keccak256(bytes(caseList[ID-1].SUID))!=keccak256(bytes(SUID)),"No changes");
        string memory prevSUID = caseList[ID-1].SUID;
        caseList[ID-1].SUID= SUID;
        trackChangeinSUID.push(TrackChangeinSUID(ID,caseList[ID-1].UID,prevSUID,SUID,msg.sender,block.timestamp));
        // trackChangeinSUIDMap[UID].push(TrackChangeinSUID(caseID,UID,prevSUID,SUID,msg.sender,block.timestamp));
    }

    function viewTrackChangeinSUID()public view returns(TrackChangeinSUID[] memory){
        return trackChangeinSUID;
    }

    function addEvidence(string memory filename, string memory filetype, string memory desc, uint256 caseID, string memory hash) public   {
        require(!EvidenceisinList[hash] ,"Evidenece already in List");
        require(caseList[caseID-1].ID==caseID,"Case doesn't exist");
        evidenceCount++;
        evidence.push(Evidence(evidenceCount,filename,filetype,desc,true,msg.sender,caseID,hash,block.timestamp));
        EvidenceisinList[hash]=true;
        HashEvidence[hash]=evidenceCount;
        CaseEvidence[caseList[caseID-1].UID].push(Evidence(evidenceCount,filename,filetype,desc,true,msg.sender,caseID,hash,block.timestamp));
    }

    function updateEvidenceValid(uint256 _ID )public {
        require(EvidenceisinList[evidence[_ID-1].hash],"Evidence doesn't exist");
        // require(evidence[_ID-1].valid!=_valid,"No changes"); 
        if(evidence[_ID-1].valid == true){
        trackEvidence.push(TrackEvidence(_ID,evidence[_ID-1].caseID,true,false,msg.sender,block.timestamp));
        evidence[_ID-1].valid=false;
        string memory UID = caseList[(evidence[_ID-1].caseID)-1].UID;
        CaseEvidence[UID][_ID-1].valid=false;
        }else{
        trackEvidence.push(TrackEvidence(_ID,evidence[_ID-1].caseID,false,true,msg.sender,block.timestamp));
        evidence[_ID-1].valid=true;
        string memory UID = caseList[(evidence[_ID-1].caseID)-1].UID;
        CaseEvidence[UID][_ID-1].valid=true;
        } 
        
    }

    function viewEvidence() public view returns(Evidence[] memory){
        return evidence;
    }

    function viewChangesInEvidence() public view returns(TrackEvidence[] memory){
        return trackEvidence;
    }

   

}

